import React, { useState, useEffect } from 'react';
import './Watchlist.css';

const Watchlist = () => {
  const [marketIndices, setMarketIndices] = useState([
    { name: 'NIFTY', number: '50', value: 10865.65, change: -1.37 },
    { name: 'SENSEX', number: '', value: 35400.61, change: 1.41 }
  ]);

  const [stocks, setStocks] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchStocks = async () => {
      try {
        const response = await fetch('http://localhost:5000/api/stocks');
        
        if (!response.ok) {
          throw new Error(`HTTP error! status: ${response.status}`);
        }
        
        const data = await response.json();
        setStocks(data);
        setError(null);
      } catch (error) {
        console.error('Error fetching stocks:', error);
        setError(error.message);
        // Fallback mock data
        setStocks([
          { symbol: 'HDFCBANK', price: 1567.30, change: 8.75 },
         
          { symbol: 'TCS', price: 3452.10, change: -5.25 }
        ]);
      } finally {
        setLoading(false);
      }
    };

    fetchStocks();
  }, []);

  const formatNumber = (num) => {
    return num.toLocaleString('en-IN', { maximumFractionDigits: 2 });
  };

  if (loading) return <div className="watchlist-loading">Loading market data...</div>;

  return (
    <div className="watchlist-container">
      {/* Market Indices - SENSEX moved to right */}
      <div className="market-indices">
        <div className="index-card">
          <div className="index-name">{marketIndices[0].name}</div>
          <div className="index-number">{marketIndices[0].number}</div>
          <div className="index-value">{formatNumber(marketIndices[0].value)}</div>
          <div className={`index-change ${marketIndices[0].change >= 0 ? 'positive' : 'negative'}`}>
            {marketIndices[0].change >= 0 ? '+' : ''}{marketIndices[0].change}%
          </div>
        </div>
        
        <div className="sensex-container">
          <div className="index-card align-right">
            <div className="index-name">{marketIndices[1].name}</div>
            <div className="index-value">{formatNumber(marketIndices[1].value)}</div>
            <div className={`index-change ${marketIndices[1].change >= 0 ? 'positive' : 'negative'}`}>
              {marketIndices[1].change >= 0 ? '+' : ''}{marketIndices[1].change}%
            </div>
          </div>
        </div>
      </div>

      {/* Stock List */}
      <div className="stock-list">
        {error && (
          <div className="watchlist-error">
            {error} (Using mock data)
            <button onClick={() => window.location.reload()}>Retry</button>
          </div>
        )}
        
        <div className="stock-columns">
          <div className="stock-names">
            {stocks.map((stock, i) => (
              <div key={i} className="stock-row">
                <div className="stock-symbol">{stock.symbol}</div>
                <div className={`stock-change ${stock.change >= 0 ? 'positive' : 'negative'}`}>
                  {stock.change >= 0 ? '+' : ''}{stock.change}
                </div>
              </div>
            ))}
          </div>
          
          <div className="stock-prices">
            {stocks.map((stock, i) => (
              <div key={i} className="stock-price">{formatNumber(stock.price)}</div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Watchlist;
